import { WeatherApi } from "../../src/api/api"

export function Weather() {
    fetch("https://opendata.cwb.gov.tw/api/v1/rest/datastore/F-C0032-001?Authorization=CWB-A0E4A14B-FEB4-49ED-8473-4DD8300A8518&limit=20&offset=0&format=JSON&locationName=新竹市&elementName=", {
        method: "GET",
    })
        .then(response => {
            return response.json()
        })
        .then(data => {
            return <div>天氣預測</div>
        })
        .catch(function (error) {
            console.log(error)
        });
    
}
